import React from 'react';
import classes from './menuTemplate.module.scss';
import Menu from '../../components/Menu/Menu';

function MenuTemplate({props}) {
  return (
    <div className={classes.menuTemplate}>
        {props.content}
    </div>
  )
}

export default MenuTemplate
